import '../styles/MyInputStyle.css';


const MyInput = ({type, placeholder, value, onChange}) => {
        return (
            <div className="custom-input-conteiner">
                <input
                    type={type}
                    placeholder={placeholder}
                    value={value}
                    onChange={onChange}
                    className='custom-input'
                />
            </div>
        );
    }

export default MyInput;
